// Compiler result to JSON file
import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;
import AwPopupCommandBar from 'viewmodel/AwPopupCommandBarViewModel';
import AwFlexRow from 'viewmodel/AwFlexRowViewModel';
import AwLinkWithPopupMenu from 'viewmodel/AwLinkWithPopupMenuViewModel';
import AwNumeric from 'viewmodel/AwNumericViewModel';
import AwFlexColumn from 'viewmodel/AwFlexColumnViewModel';
import AwTogglebutton from 'viewmodel/AwTogglebuttonViewModel';
import AwLabel from 'viewmodel/AwLabelViewModel';
import AwList from 'viewmodel/AwListViewModel';
import AwListCheckboxItem from 'viewmodel/AwListCheckboxItemViewModel';
import AwButton from 'viewmodel/AwButtonViewModel';
import AwI18n from 'viewmodel/AwI18nViewModel';
import { ExistWhen,AwEnterKey,AwClass } from 'js/hocCollection';
const DivExistWhen = ExistWhen('div');
const AwFlexRowExistWhen = ExistWhen(AwFlexRow);
const AwNumericAwEnterKey = AwEnterKey(AwNumeric);
const AwLabelExistWhen = ExistWhen(AwLabel);
const AwButtonAwClass = AwClass(AwButton);



/*
ctx imports
*/

const ctxImportObj = {  };


/*
dynamic import
 */
registerDynImportEntry('js/awColumnFilterService', () => import('js/awColumnFilterService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "actions": {
        "reveal": {
            "actionType": "batchJob",
            "steps": [
                {
                    "action": "initializeMenu"
                },
                {
                    "action": "checkForFilterDisability"
                },
                {
                    "action": "initializeFacetDataProvider",
                    "condition": "data.showFilters.dbValue === true && ctx.columnMenuContext.isFacetLoading === false"
                }
            ]
        },
        "initializeMenu": {
            "actionType": "JSFunction",
            "method": "initializeMenu",
            "inputData": {
                "column": "{{subPanelContext.gridContext.columnDef}}",
                "columnFilterData": "{{subPanelContext.gridContext.columnDef.filter}}",
                "columnMenuData": "{{subPanelContext.gridContext.columnDef.filter.columnMenuData}}"
            },
            "outputData": {
                "numberValue.dbValue": "columnMenuData.numberValue.dbValue",
                "numberValue.value": "columnMenuData.numberValue.dbValue",
                "startNumber.dbValue": "columnMenuData.startNumber.dbValue",
                "startNumber.value": "columnMenuData.startNumber.dbValue",
                "endNumber.dbValue": "columnMenuData.endNumber.dbValue",
                "endNumber.value": "columnMenuData.endNumber.dbValue",
                "operation.dbValue": "columnMenuData.operation.dbValue",
                "operation.uiValue": "columnMenuData.operation.uiValue",
                "showFilters.dbValue": "columnMenuData.showFilterFacets"
            },
            "deps": "js/awColumnFilterService"
        },
        "initializeFacetDataProvider": {
            "actionType": "dataProvider",
            "method": "facetDataProvider"
        },
        "filterAction": {
            "actionType": "JSFunction",
            "method": "doNumericFiltering",
            "inputData": {
                "column": "{{subPanelContext.gridContext.columnDef}}",
                "viewModelData": "{{data.data}}",
                "facetDataProvider": "{{data.dataProviders.facetDataProvider}}",
                "gridContextDispatcher": "{{subPanelContext.gridContextDispatcher}}"
            },
            "outputData": {
                "newFilters": "newFilters"
            },
            "deps": "js/awColumnFilterService"
        },
        "numericFilterInputChangedBatch": {
            "actionType": "batchJob",
            "steps": [
                {
                    "action": "numericFilterInputChanged"
                },
                {
                    "action": "initializeFacetValuesDebounce",
                    "condition": "data.showFilters.dbValue === true && ctx.columnMenuContext.isFacetLoading === false"
                }
            ]
        },
        "numericFilterInputChanged": {
            "actionType": "JSFunction",
            "method": "numericFilterInputChanged",
            "inputData": {
                "gridContextDispatcher": "{{subPanelContext.gridContextDispatcher}}",
                "column": "{{subPanelContext.gridContext.columnDef}}",
                "viewModelData": "{{data.data}}",
                "isBulkEditing": "{{subPanelContext.gridContext.isBulkediting}}",
                "isFilterDisabled": "{{fields.isFilterDisabled}}"
            },
            "deps": "js/awColumnFilterService"
        },
        "initializeFacetValues": {
            "actionType": "JSFunctionAsync",
            "method": "loadFacetValues",
            "inputData": {
                "gridContextDispatcher": "{{subPanelContext.gridContextDispatcher}}",
                "column": "{{subPanelContext.gridContext.columnDef}}",
                "viewModel": "{{data}}",
                "subPanelContext": "{{subPanelContext}}",
                "facetDataProvider": "{{data.dataProviders.facetDataProvider}}",
                "reloadValues": true,
                "isFilterDisabled": "{{fields.isFilterDisabled}}"
            },
            "outputData": {
                "searchResults": ""
            },
            "deps": "js/awColumnFilterService"
        },
        "initializeFacetValuesDebounce": {
            "actionType": "JSFunctionAsync",
            "method": "updateFacetValuesDebounce",
            "inputData": {
                "gridContextDispatcher": "{{subPanelContext.gridContextDispatcher}}",
                "column": "{{subPanelContext.gridContext.columnDef}}",
                "viewModel": "{{data}}",
                "subPanelContext": "{{subPanelContext}}",
                "facetDataProvider": "{{data.dataProviders.facetDataProvider}}",
                "reloadValues": true,
                "isFilterDisabled": "{{fields.isFilterDisabled}}"
            },
            "deps": "js/awColumnFilterService"
        },
        "loadFacetValues": {
            "actionType": "JSFunctionAsync",
            "method": "loadFacetValues",
            "inputData": {
                "gridContextDispatcher": "{{subPanelContext.gridContextDispatcher}}",
                "column": "{{subPanelContext.gridContext.columnDef}}",
                "viewModel": "{{data}}",
                "subPanelContext": "{{subPanelContext}}",
                "facetDataProvider": "{{data.dataProviders.facetDataProvider}}",
                "reloadValues": false,
                "isFilterDisabled": "{{fields.isFilterDisabled}}"
            },
            "outputData": {
                "searchResults": ""
            },
            "deps": "js/awColumnFilterService"
        },
        "showFiltersToggleChanged": {
            "actionType": "JSFunction",
            "method": "showFiltersToggleChanged",
            "inputData": {
                "gridContextDispatcher": "{{subPanelContext.gridContextDispatcher}}",
                "column": "{{subPanelContext.gridContext.columnDef}}",
                "viewModelData": "{{data.data}}"
            },
            "deps": "js/awColumnFilterService"
        },
        "showFiltersToggleChangedBatch": {
            "actionType": "batchJob",
            "steps": [
                {
                    "action": "showFiltersToggleChanged"
                },
                {
                    "action": "initializeFacetDataProvider",
                    "condition": "data.showFilters.dbValue === true && ctx.columnMenuContext.isFacetLoading === false"
                }
            ]
        },
        "filterFacetInputChanged": {
            "actionType": "JSFunction",
            "method": "filterFacetInputChanged",
            "inputData": {
                "gridContextDispatcher": "{{subPanelContext.gridContextDispatcher}}",
                "column": "{{subPanelContext.gridContext.columnDef}}",
                "viewModelData": "{{data.data}}",
                "facetDataProvider": "{{data.dataProviders.facetDataProvider}}",
                "facetParameters": "{{parameters}}",
                "isBulkEditing": "{{subPanelContext.gridContext.isBulkediting}}",
                "isFilterDisabled": "{{fields.isFilterDisabled}}"
            },
            "outputData": {
                "facetValue": ""
            },
            "deps": "js/awColumnFilterService"
        },
        "clearFilter": {
            "actionType": "JSFunction",
            "method": "clearFilterFromMenu",
            "inputData": {
                "column": "{{subPanelContext.gridContext.columnDef}}",
                "gridContextDispatcher": "{{subPanelContext.gridContextDispatcher}}"
            },
            "outputData": {
                "newFilters": ""
            },
            "deps": "js/awColumnFilterService"
        },
        "checkForFilterDisability": {
            "actionType": "JSFunction",
            "method": "checkForFilterDisability",
            "inputData": {
                "column": "{{subPanelContext.gridContext.columnDef}}",
                "viewModelData": "{{data.data}}",
                "hasFilterFacetAction": "{{subPanelContext.hasFilterFacetAction}}",
                "facetDataProvider": "{{data.dataProviders.facetDataProvider}}",
                "isBulkEditing": "{{subPanelContext.gridContext.isBulkediting}}",
                "isFilterDisabled": "{{fields.isFilterDisabled}}"
            },
            "deps": "js/awColumnFilterService"
        }
    },
    "data": {
        "numberValue": {
            "displayName": "",
            "type": "DOUBLE",
            "isRequired": "false",
            "isEditable": "true",
            "dbValue": "",
            "dispValue": ""
        },
        "startNumber": {
            "displayName": "{{i18n.fromTitle}}",
            "propertyLabelDisplay": "PROPERTY_LABEL_AT_TOP",
            "type": "DOUBLE",
            "isRequired": "false",
            "isEditable": "true",
            "dbValue": "",
            "dispValue": ""
        },
        "endNumber": {
            "displayName": "{{i18n.toTitle}}",
            "propertyLabelDisplay": "PROPERTY_LABEL_AT_TOP",
            "type": "DOUBLE",
            "isRequired": "false",
            "isEditable": "true",
            "dbValue": "",
            "dispValue": ""
        },
        "operation": {
            "type": "STRING",
            "isRequired": "false",
            "isEditable": "true"
        },
        "_linkOptions_operationsLink": {
            "hasPopup": true,
            "iconOptions": {
                "title": "textOnly",
                "cell": "textOnly"
            }
        },
        "_itemOptions_facetCheckbox": {
            "applySelection": false
        },
        "showFilters": {
            "displayName": "{{i18n.toggleFacetTitle}}",
            "type": "BOOLEAN",
            "isRequired": "false",
            "isEditable": "true",
            "value": "",
            "labelPosition": "PROPERTY_LABEL_AT_SIDE"
        },
        "noMatchesFound": {
            "type": "STRING",
            "isRequired": "false",
            "isEditable": "false",
            "dbValue": "{{i18n.noMatchesFound}}",
            "displayValue": "{{i18n.noMatchesFound}}"
        },
        "isFilterDisabled": {
            "initialValues": {
                "value": true
            },
            "meta": {}
        }
    },
    "dataProviders": {
        "facetDataProvider": {
            "action": "initializeFacetValues",
            "nextAction": "loadFacetValues",
            "response": "{{data.searchResults.results}}",
            "totalFound": "{{data.searchResults.totalFound}}",
            "selectionModelMode": "none"
        },
        "operationsDataProvider": {
            "response": [
                {
                    "propDisplayValue": "{{i18n.equalsOperation}}",
                    "propInternalValue": "equals",
                    "selected": false
                },
                {
                    "propDisplayValue": "{{i18n.lessThanOperation}}",
                    "propInternalValue": "lt",
                    "selected": false
                },
                {
                    "propDisplayValue": "{{i18n.greaterThanOperation}}",
                    "propInternalValue": "gt",
                    "selected": false
                },
                {
                    "propDisplayValue": "{{i18n.rangeOperation}}",
                    "propInternalValue": "range",
                    "selected": false
                }
            ],
            "totalFound": 4
        }
    },
    "functions": {
        "getActiveWorkspaceXrtContext": {
            "functionName": "getActiveWorkspaceXrtContext",
            "parameters": [
                "{{ctx.ActiveWorkspace:xrtContext}}"
            ]
        }
    },
    "onEvent": [
        {
            "eventId": "awlinkPopup.selected",
            "action": "numericFilterInputChangedBatch"
        }
    ],
    "i18n": {
        "clearButtonTitle": [
            "UIMessages"
        ],
        "containsOperation": [
            "UIMessages"
        ],
        "notContainsOperation": [
            "UIMessages"
        ],
        "startsWithOperation": [
            "UIMessages"
        ],
        "endsWithOperation": [
            "UIMessages"
        ],
        "equalsOperation": [
            "UIMessages"
        ],
        "notEqualsOperation": [
            "UIMessages"
        ],
        "lessThanOperation": [
            "UIMessages"
        ],
        "greaterThanOperation": [
            "UIMessages"
        ],
        "rangeOperation": [
            "UIMessages"
        ],
        "fromTitle": [
            "UIMessages"
        ],
        "toTitle": [
            "UIMessages"
        ],
        "FILTER_TEXT": [
            "BaseMessages"
        ],
        "searchText": [
            "UIMessages"
        ],
        "toggleFacetTitle": [
            "UIMessages"
        ],
        "noMatchesFound": [
            "UIMessages"
        ],
        "selectAll": [
            "UIMessages"
        ]
    },
    "messages": {},
    "conditions": {
        "isShowFiltersSelected": {
            "expression": "data.showFilters.dbValue === true"
        },
        "filteringEnabled": {
            "expression": "subPanelContext.gridContext.columnDef.filter.view && subPanelContext.gridContext.columnDef.isFilteringEnabled !== false && subPanelContext.gridOptions.isFilteringEnabled"
        },
        "noFacetResults": {
            "expression": "dataProviders.facetDataProvider.viewModelCollection.totalFound === 0 && ctx.columnMenuContext.isFacetLoading === false"
        }
    },
    "lifecycleHooks": {
        "onMount": "reveal",
        "onUpdate": [
            {
                "action": "numericFilterInputChangedBatch",
                "observers": [
                    "viewModel.data.numberValue.dbValue",
                    "viewModel.data.startNumber.dbValue",
                    "viewModel.data.endNumber.dbValue"
                ]
            },
            {
                "action": "checkForFilterDisability",
                "observers": [
                    "viewModel.data.showFilters.dbValue"
                ]
            }
        ]
    },
    "_viewModelId": "splmTableNumericColumnMenu",
    "_uniqueViewModelId": "splmTableNumericColumnMenu",
    "ctx": {
        "columnMenuContext": {
            "type": "object"
        },
        "ActiveWorkspace": {
            "type": "object"
        }
    }
};

